import React from 'react';
import {HeaderContainer, LogoContainer, OptionLink, OptionsContainer, ImageStyles, NameContainer} from './header.styles';


import {connect} from 'react-redux';
import {createStructuredSelector} from 'reselect';

import CartIcon from '../cart-icon/cart-icon.component';

import CartDropdown from '../cart-dropdown/cart-dropdown.component';

import {selectCurrentUser} from '../../redux/user/user.selector';
import {signOutStart} from '../../redux/user/user.actions';
import {selectCartHidden} from '../../redux/cart/cart.selectors';
// import {ReactComponent as Logo} from '../../assets/crown.svg';

const Header = ({currentUser, hidden, startSignOut}) =>(
<HeaderContainer>
    <LogoContainer to="/">
        {/* <Logo className='logo'/> */}

        <ImageStyles src="data:image/png;base64,"/>
        <NameContainer>Osasis</NameContainer> 
        <NameContainer>Yipee</NameContainer>
    </LogoContainer>

    <OptionsContainer>
        <OptionLink to='/shop'>
            SHOP
        </OptionLink>
        <OptionLink to='/contact'>
            CONTACT
        </OptionLink>
        {
            currentUser ? <OptionLink as='div' onClick={()=> startSignOut()}>LOG OUT</OptionLink>
            :
            <OptionLink to='/login'>
            LOG IN
            </OptionLink>

        }

        <CartIcon />    



    </OptionsContainer>
    {
        hidden ? null
            :
            <CartDropdown />    
    }

</HeaderContainer>
);





//multiple state selectors we use createStructuredSelector
const mapStateToProps = createStructuredSelector({
    currentUser: selectCurrentUser,
    hidden: selectCartHidden
});

const mapDispatchToProps = dispatch =>({
    startSignOut: () => dispatch(signOutStart())
})
export default connect(mapStateToProps,mapDispatchToProps)(Header);
